  render() {
    return (
      <div id="Nav-Bar">
        <AppBar position="static">
          <Toolbar>
            <Typography variant="h6" >
              News
            </Typography>
            <div id='search-bar'>
            <div id='search-icon'>
              <SearchIcon />
            </div>
            <InputBase
              placeholder="Searchâ€¦"
              inputProps={{ 'aria-label': 'search' }}
            />
          </div>
          </Toolbar>
        </AppBar>
      </div>
    );
  }
}
